import React, {useEffect} from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { userData } from './action';
import { useNavigate } from 'react-router-dom';
export const User = () => {
  const dispatch=useDispatch()
  const {user}= useSelector((state)=>state.user)
  const navigate=useNavigate();
  useEffect(()=>{
    dispatch(userData())},[]
  )
  return (
    <div key={user.id} style={{display:"grid", gridTemplateColumns:"1fr 1fr 1fr 1fr 1fr"}}>
      {user.map((item,index)=>{return( <div style={{ border:"solid 1px black"}}>
    <p> {item.id}</p>
    <p> {item.name}</p>
    <p> {item.username}</p>
    <p> {item.email}</p>
    <button onClick={()=>navigate("userpost")}>post</button>
    </div>)})}</div>
  )
}
